import React from 'react';
import './LibraryCSS/Header.css';


function LibraryHeading() {

  return (
    <div className="Header-Div">
      <div className="Row">
        <div className="Header-Middle">
          <button/>
        </div>
        <br/>
        <div className="Header-Middle">
          <p>Library</p>
        </div>
        <div className="Header-Middle" id="Profile">
          <a href="/"><button /></a>
        </div>
      </div>
    </div>
  );
}

export default LibraryHeading;
